import React from "react";

const ShowPopup = () => {
  return (
    <div className="overlay">
      <div className="popup">
        <div className="row">
            <div className="col-lg-2">studentId</div>
            <div className="col-lg-5">firstname</div>
            <div className="col-lg-5">lastname</div>
        </div>
        <div className="row">
        <div className="col-lg-4">city</div>
            <div className="col-lg-4">dob</div>
            <div className="col-lg-4">phone</div>
        </div>
        <div className="row"></div>
      </div>
    </div>
  );
};

export default ShowPopup;
